INSERT INTO `videos_mcq` VALUES (1,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">When we purchase goods from our supplier the suppliers account is</span></span></p>','Debited','Credited','','','Credited',11,'','',0),(2,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When we sell goods for Cash the Cash A/c is</span></span></p>','Debited','Credited','','','Debited',12,'','',0),(3,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">When we withdraw money from the bank and put it in the cash box. The Cash A/c</span></span></p>','Is Debited','Is Credited','','','Is Debited',12,'','',0),(4,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When we give Commission the Commission Expense account is</span></span></p>','Debited','Credited','','','Debited',12,'','',0),(5,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">when we give discount to our customer that Discount Given is</span></span></p>','Debited','Credited','','','Debited',12,'','',0),(6,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">when bank deducts money from our account as a charge then the Bank Account is</span></span></p>','Debited','Credited','','','Credited',12,'','',0),(7,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Checked Page 1 &amp; Page 2 in Volume 1</span></span></p>','Yes','No','','','Yes',12,'','',1),(8,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">In the Ledger if the total of Debits is 1,100 Dr and the total of Credits is 1,000 Cr then the closing balance of the Ledger is</span></span></p>','100 Dr','100 Cr','2,100 Dr','2,100 Cr','100 Dr',13,'','',0),(9,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">The Closing Balance of Cash A/c is always</span></span></p>','Debit','Credit','','','Debit',14,'','',0),(10,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Ledger of Bank Account appears in:</span></span></p>','Trading account','Profit and loss account','Balance sheet','','Balance sheet',15,'','',0),(11,'<p>Do you understand the topic?</p>','Yes','No','','','Yes',30,'','',1),(12,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Machinery is</span></span></p>','Real Account','Personal Account','Nominal Account','','Real Account',16,'','',0),(13,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Suppliers Account is</span></span></p>','Real Account','Personal Account','Nominal Account','','Personal Account',16,'','',0),(14,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Bank Account is</span></span></p>','Real Account','Personal Account','Nominal Account','','Personal Account',16,'','',0),(15,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Sales Account is</span></span></p>','Real Account','Personal Account','Nominal Account','','Nominal Account',16,'','',0),(16,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When closing balance of a ledger is Credit (10,000 Cr) that means</span></span></p>','10,000 is in the Bank','Till now we have spent to 10,000 on Tea Expenses','Till now we have purchased goods worth 10,000','Till now we have sold goods worth 10,000','Till now we have sold goods worth 10,000',16,'','',0),(17,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When closing balance of a ledger is Debit (100 Dr) that means</span></span></p>','We have to give 100 to someone','We have to take 100 from someone','We have earned 100 buy receiving commission','We have to repay loan of ₹100','We have to take 100 from someone',16,'','',0),(18,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">The closing balance of Cash Account must be</span></span></p>','Debit','Credit','','','Debit',16,'','',0),(19,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Purchase A/c appears in the</span></span></p>','Trading account','Profit and loss account','Balance sheet','','Trading account',15,'','',0),(20,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Indirect expenses appear in</span></span></p>','Trading account','Profit and loss account','Balance sheet','','Profit and loss account',15,'','',0),(21,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">The closing balance of Loan Taken must be</span></span></p>','Debit','Credit','','','Credit',16,'','',0),(22,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">The closing balance of Purchase A/c is</span></span></p>','Debit','Credit','','','Debit',16,'','',0),(23,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Sales is a</span></span></p>','Asset','Liability','Income','Expense','Income',16,'','',0),(24,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">In the Trading Account the Gross Profit is shown on the</span></span></p>','Debit Side','Credit Side','','','Debit Side',17,'','',0),(25,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">If the Closing Balance shown in the Profit &amp; Loss A/c is on the Debit side it is</span></span></p>','Gross Profit','Gross Loss','Net Profit','Net Loss','Net Profit',17,'','',0),(26,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">In the Balance Sheet Net Profit appears on the</span></span></p>','Asset Side','Liability Side','','','Liability Side',17,'','',0),(27,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Which one is NOT a method of Inventory Evaluation.</span></span></p>','FIFO','TIFO','LIFO','Weighted Average','TIFO',18,'','',0),(28,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">To Shut a selected Company</span></span></p>','Alt + F1','Ctrl + F3','From the Company menu select Shut Company.','All of the above','All of the above',19,'','',0),(29,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">On creating a company data of TallyPrime is stored in a folder. This folder is given a number which of the following is the correct name of such a folder.</span></span></p>','904953','90495','9049','9049A','90495',19,'','',0),(30,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Suppliers are called Sundry Creditors and Customers are called Sundry Debtors</span></span></p>','True','False','','','True',19,'','',0),(31,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When we receive money, we record the transaction in the voucher</span></span></p>','Receipt','Payment','Contra','Journal','Receipt',20,'','',0),(32,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">When we transfer money from one bank to other bank, we record the transaction in the voucher</span></span></p>','Receipt','Payment','Contra','Journal','Contra',20,'','',0),(33,'<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">To change the mode of a Voucher we press Ctrl + H</span></span></p>','True','False','','','True',20,'','',0);
